INSERT INTO `livros` (`id`, `titulo`, `numero_paginas`, `autor`, `editora`, `generos`, `resumo`, `img_base64`, `is_aprovado`) VALUES
(9, 'Harry Potter e a Ordem da Fênix', 703, 'J.K. Rowling', 'Pottermore Publishing', '{\"Ficção\":\"\",\"Literatura Fantástica\":\"\"}', 'Você está compartilhando os pensamentos e emoções do Lorde das Trevas. O diretor acha que é desaconselhável que isto continue a acontecer. E quer que eu lhe ensine como fechar a mente ao Lorde das Trevas.\'\n\nTempos sombrios se abateram sobre Hogwarts. Depois do ataque dos Dementadores ao seu primo Dudley, Harry Potter sabe que Voldemort fará tudo para encontrá-lo. Muitos negam o retorno do Lorde das Trevas, mas Harry não está sozinho: uma ordem secreta se reúne no Largo Grimmauld para fazer frente às forças sombrias. Harry precisa permitir que o professor Snape o ensine a se proteger dos vorazes ataques de Voldemort à sua mente. Mas eles estão ficando cada vez mais fortes, e o tempo de Harry está acabando...', '', 1);
INSERT INTO `livros` (`id`, `titulo`, `numero_paginas`, `autor`, `editora`, `generos`, `resumo`, `img_base64`, `is_aprovado`) VALUES
(30, 'Grande Sertão: Veredas', 552, 'Guimarães Rosa', 'Companhia Das Letras', '{\"Ficção\":\"\"}', 'Uma das obras fundamentais da literatura brasileira, em nova edição. Publicado originalmente em 1956, Grande sertão: veredas, de João Guimarães Rosa, revolucionou o cânone brasileiro e segue despertando o interesse de renovadas gerações de leitores. Ao atribuir ao sertão mineiro sua dimensão universal, a obra é um mergulho profundo na alma humana, capaz de retratar o amor, o sofrimento, a força, a violência e a alegria. Esta nova edição conta com novo estabelecimento de texto, cronologia ilustrada, indicações de leituras e célebres textos publicados sobre o romance, incluindo um breve recorte da correspondência entre Clarice Lispector e Fernando Sabino e escritos de Roberto Schwarz, Walnice Nogueira Galvão, Benedito Nunes, Davi Arrigucci Jr. e Silviano Santiago. ', '', 1);
INSERT INTO `livros` (`id`, `titulo`, `numero_paginas`, `autor`, `editora`, `generos`, `resumo`, `img_base64`, `is_aprovado`) VALUES
(31, ' Harry Potter e a Pedra Filosofal', 223, 'J.K. Rowling', 'Pottermore Publishing', '{\"Romance\":\"\",\"Literatura Fantástica\":\"\"}', 'Harry Potter nunca havia ouvido falar de Hogwarts quando as cartas começaram a aparecer no capacho da Rua dos Alfeneiros, no 4. Escritos a tinta verde-esmeralda em pergaminho amarelado com um lacre de cera púrpura, as cartas eram rapidamente confiscadas por seus pavorosos tio e tia. Então, no aniversário de onze anos de Harry, um gigante com olhos que luziam como besouros negros chamado Rúbeo Hagrid surge com notícias surpreendentes: Harry Potter é um bruxo e tem uma vaga na Escola de Magia e Bruxaria de Hogwarts. Uma incrível aventura está para começar!', '', 1);
INSERT INTO `livros` (`id`, `titulo`, `numero_paginas`, `autor`, `editora`, `generos`, `resumo`, `img_base64`, `is_aprovado`) VALUES
(33, 'O Hobbit', 336, 'J.R.R. Tolkien', 'HarperCollins Brasil', '{\"Romance\":\"\",\"Literatura Fantástica\":\"\"}', 'Bilbo Bolseiro era um dos mais respeitáveis hobbits de todo o Condado até que, um dia, o mago Gandalf bate à sua porta. A partir de então, toda sua vida pacata e campestre soprando anéis de fumaça com seu belo cachimbo começa a mudar. Ele é convocado a participar de uma aventura por ninguém menos do que Thorin Escudo-de-Carvalho, um príncipe do poderoso povo dos Anãos. Essa jornada fará Bilbo, Gandalf e 13 anãos atravessarem a Terra-média, passando por inúmeros perigos, sejam eles, os imensos trols, as Montanhas Nevoentas infestadas de gobelins ou a muito antiga e misteriosa Trevamata, até chegarem (se conseguirem) na Montanha Solitária. Lá está um incalculável tesouro, mas há um porém. Deitado em cima dele está Smaug, o Dourado, um dragão malicioso que... bem, você terá que ler e descobrir. Lançado em 1937, O Hobbit é um divisor de águas na literatura fantástica mundial.', '', 1);
INSERT INTO `livros` (`id`, `titulo`, `numero_paginas`, `autor`, `editora`, `generos`, `resumo`, `img_base64`, `is_aprovado`) VALUES
(34, 'Harry Potter e o prisioneiro de Azkaban', 345, 'J.K. Rowling', 'Pottermore Publishing', '{\"Romance\":\"\",\"Literatura Fantástica\":\"\"}', 'Daquela vez Harry Potter não conseguira conter-se. Quebrara uma das regras principais de Hogwarts - não exercer técnicas de feitiçaria fora dos muros da escola. Mas aquela detestável Tia Marge merecia permanecer umas boas horas suspensa no tecto da sala dos Dursleys, inchada como um balão. Além disso já faltavam poucos dias para recomeçar as aulas. Mas o seu terceiro ano não irá ser fácil. Da prisão de Azkaban fugira o feroz Sirus Black, um dos mais fiéis seguidores do assustador Lord Voldemort para o que Harry Potter continuava a ser o alvo favorito. O pior é que o herói de J. K. Rowling começa a suspeitar da existência de um traidor entre os seus próprios amigos...\n\n', '', 1);

